const student = [
    {
        path: "/student",
        component: () => import("../layouts/student.vue"),
        children: [
            {
                path: "score",
                name: "student-score",
                component: () => import ("../pages/student/score/index.vue"),
            },
            {
                path: "chat",
                name: "student-chat",
                component: () => import ("../pages/student/chat/index.vue"),
            },
            {
                path: "forum",
                name: "student-forum",
                component: () => import ("../pages/student/forum/index.vue"),
            },
            {
                path: "cour",
                name: "student-forum",
                component: () => import ("../pages/student/forum/index.vue"),
            },
        ]
    }
];

export default student;
